  export default App;
  `,explanation:"A basic React functional component, demonstrating the structure provided by the React framework for building UIs."}]},{term:"Library",definition:"A collection of pre-written code that can be used to perform common tasks, making programming faster and more efficient.",examples:[{language:"JavaScript (Lodash)",code:`// Using Lodash library for utility functions
  import _ from 'lodash';
  
  const numbers = [1, 2, 3, 4, 5];
  const sum = _.sum(numbers); // Sums array elements
