  `,explanation:"Common Git commands used for initializing a repository, staging, committing, and pushing code."}]},{term:"Repository",definition:"A central location where all the files, folders, and history of a project are stored, typically used with version control systems.",examples:[{language:"Git (Concept)",code:`// A local Git repository typically looks like:
  // my_project/
  //   .git/         <-- This hidden folder contains all history
  //   src/
  //   public/
  //   README.md
  //   ... other project files
  `,explanation:"A Git repository (often called 'repo') contains all project files and the `.git` directory which stores the version history."}]},{term:"IDE (Integrated Development Environment)",definition:"A software application that provides comprehensive facilities to computer programmers for software development. An IDE normally consists of at least a source code editor, build automation tools, and a debugger.",examples:[{language:"General (Concept)",code:`// Common IDEs:
  // Visual Studio Code (VS Code)
