  `,explanation:"Declaring float variables and performing multiplication."}]},{term:"Comments",definition:"Non-executable lines of text within source code used to explain the code, document its purpose, or temporarily disable parts of it. They are ignored by the compiler/interpreter.",examples:[{language:"JavaScript",code:`// This is a single-line comment
  
